import React, { useState } from 'react';
import SignInSide from './components/SignInSide';
import SignUp from './components/SignUp';
import Navbar from './components/NavBar';
import {Routes,Route} from "react-router-dom"
import Home from './components/Home';
import Profil from './components/Profil'
import ManageProfil from './components/ManageProfil';
import HouseDetails from './components/HouseDetails';
import ListHouses from './components/ListHouses';
function App() {
  const [houseId, setHouseId] = useState(null);
  const [houses, setHouses] = useState([]);
  const [images, setImages] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  console.log("this is ",images)
console.log(houses)


  const getId = (id)=>{
    setHouseId(id)
  }
  const getData =(houses)=>{
    setHouses(houses)
  }
const getImages =(images)=>{
  setImages(images)
}

const onSearch = (filteredData) => {
  setFilteredData(filteredData);
};
  
  return (

    <div>
    {/* <SignInSide /> */}
    <Navbar />
    <Routes>
        <Route path='/home' element={<Home getId={getId} getData={getData} getImages={getImages} houses={houses} />} />
        <Route path='/Profil' element={<Profil />} /> 
        <Route path='/Settings/ManageProfil' element ={ <ManageProfil />} />
        <Route path='/' element={<SignInSide />} />
        <Route path='/signUp' element={<SignUp />} />
        <Route path='/houseDetails/' element={<HouseDetails houseId={houseId} houses={houses} images={images} />} />
        <Route path={`/ListHouse/:filtred`} element={<ListHouses />} />
        
    </Routes>
    <Search houses={houses} onSearch={onSearch} /> {/* Pass the onSearch function */}
      <br />
      <ListHouses
        getId={getId}
        getData={getData}
        getImages={getImages}
        data={filteredData.length > 0 ? filteredData : houses} // Use filtered data if available
      />
    </div>  
  );
}

export default App
